import React from 'react';
import { GluestackUIProvider, Box, VStack, Button, View, useTheme } from '@gluestack-ui/themed';

import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import configuracion_usuario from './configuracion_usuario';
import { Headline } from 'react-native-paper';

function cuenta (){
    return <Box bg='red' h={600} w={250} justifyContent="center" alignItems="center">
        <TestScreen/>
    </Box>;

};
const TestScreen = () =>{
    const { toggleThemeType, themeType, isDarkTheme, theme } = useTheme();
    return(
  <View>
  <Button  onPress={toggleThemeType}>
    toggle theme
  </Button>
  <Headline>{themeType}</Headline>
  <Headline>isDarkTheme:{`${isDarkTheme}`}</Headline>
  <Headline>Primary: {theme.colors.primary}</Headline>
  </View>
  
    );
  };

export default cuenta
